import React from 'react';
import '../css/App.css';
import logo from '../img/logo.svg';

import Home from "./Home";
import About from "./About";
import Work from "./Work";

import { BrowserRouter as Router, Route, Link } from "react-router-dom";

function App() {
  return (
    <Router>
      <div className="flex flex-col font-sans min-h-screen text-grey-darkest antialiased">
        <Header />
        <main>
          <Route exact path="/" component={Home} />
          <Route path="/about" component={About} />
          <Route path="/work" component={Work} />
        </main>
      </div>
    </Router>
  );
}

function Header() {
  return (
    <header className="flex flex-col items-center pt-16 font-sans">
      <img src={logo} className="logo" alt="logo" />
      <nav className="max-w-5xl mx-auto flex md:flex-row flex-col items-center md:justify-between md:px-16">
        <ul className="flex">
          <li className="mr-6">
            <Link className="hover:text-grey-800 uppercase tracking-wide anime-gradientText-dark" to="/">Home</Link>
          </li>
          <li className="mr-6">
            <Link className="hover:text-grey-800" to="/about">About</Link>
          </li>
          <li className="mr-6">
            <Link className="hover:text-grey-800" to="/work">Work</Link>
          </li>
        </ul>
        <ul className="flex">
          <li className="mr-6">
            <Link className="hover:text-grey-800" to="/about">LinkedIn</Link>
          </li>
          <li className="mr-6">
            <Link className="hover:text-grey-800" to="/work">Hire Me</Link>
          </li>
        </ul>
      </nav>
    </header>
  );
}

export default App;
